 We can use React Context to create a global state for the Tooltip component.

## Create a Tooltip in NextJS using React Context

### Step 1: Create a Tooltip Context

Create a TooltipContext.js file in the components folder and add the following code.
```
import React, { createContext, useState } from "react";

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ tooltip, setTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```
### Step 2: Create a Tooltip Component

Create a Tooltip.js file in the components folder and add the following code.
```
import React, { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

const Tooltip = ({ children, tooltip }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div className="relative">
      {children}
      <div
        className={`absolute top-0 left-0 z-10 w-48 h-48 rounded-lg bg-white shadow-lg ${
          tooltip ? "block" : "hidden"
        }`}
      >
        <p className="text-center">{tooltip}</p>
      </div>
    </div>
  );
};

export default Tooltip;
```
### Step 3: Create a Tooltip Trigger Component

Create a TooltipTrigger.js file in the components folder and add the following code.
```
import React, { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

const TooltipTrigger = ({ children, tooltip }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div
      className="relative"
      onMouseEnter={() => setTooltip(tooltip)}
      onMouseLeave={() => setTooltip(null)}
    >
      {children}
    </div>
  );
};

export default TooltipTrigger;
```
### Step 4: Use the Tooltip Component

Now we can use the Tooltip component in our application. For example, we can use it in the index.js file as follows:
```
import React from "react";
import { TooltipProvider } from "../components/TooltipContext";
import { Tooltip, TooltipTrigger } from "../components";

export default function App() {
  return (
    <TooltipProvider>
      <TooltipTrigger tooltip="This is a tooltip">
        <button>Click me</button>
      </TooltipTrigger>
      <Tooltip>Tooltip content</Tooltip>
    </TooltipProvider>
  );
}
```
In this example, we are using the TooltipProvider component to provide the TooltipContext to the entire application. We are then using the TooltipTrigger component to trigger the tooltip when the user hovers over the button. Finally, we are using the Tooltip component to display the tooltip content.

### Conclusion

In this article, we have created a Tooltip component in NextJS using React Context. We have used the TooltipContext to create a global state for the Tooltip component. We have also used the TooltipTrigger component to trigger the tooltip when the user hovers over the button. Finally, we have used the Tooltip component to display the tooltip content.

